import React from 'react';
import './App.css';
// import { render } from 'react-dom';
// import axios from 'axios';
// import { Provider } from 'react-redux';
import APIDemo from './modules/api/fetchData';
type User = {
  face_image_base64s:Array<string>,
  id:number,
  name:string
};
type myState ={
  a:User
};

const initState: myState = {
  a:{
    face_image_base64s:[], 
    id: 0,
    name:""
  }
}
class App extends React.Component<{},myState>{
  state:myState = initState;

  UNSAFE_componentWillMount(){
    let a:APIDemo;
    a = new APIDemo();
    a.getAPI(3);
  }

  render(){
    return(
      <div className="App">
      <h1>{this.state.a.id}</h1>
      </div>
    );
  }
}

export default App;
